    <style type="text/css">
        html,body{
            -webkit-user-select: none;

        .button-room{
            margin-top: 10px;

        .button {
            color: #666;
            background-color: #EEE;
            border-color: #EEE;
            font-weight: normal;
            font-size: 16px;
            font-family: "Heitic SC Light", Helvetica Neue Light, "Helvetica Neue", Helvetica, Arial, "Lucida Grande", sans-serif;
            text-decoration: none;
            text-align: center;
            line-height: 40px;
            height: 40px;
            padding: 0 40px;
            margin: 0;
            display: inline-block;
            appearance: none;
            cursor: pointer;
            border: none;
            -webkit-box-sizing: border-box;
            -moz-box-sizing: border-box;
            box-sizing: border-box;
            -webkit-transition-property: all;
            transition-property: all;
            -webkit-transition-duration: .3s;
            transition-duration: .3s;
            position: relative;
            z-index: 2;
        }

        .button-tiny {
            font-size: 9.6px;
            height: 24px;
            line-height: 24px;
            padding: 0 24px;
        }

        .button-rounded {
            border-radius: 5px;
        }

        .button-primary,
        .button-primary-flat {
            background-color: #00AAEE;
            border-color: #1B9AF7;
            color: #FFF;
        }

        .button-primary:visited,
        .button-primary-flat:visited {
            color: #FFF;
        }

        .button-primary:hover, .button-primary:focus,
        .button-primary-flat:hover,
        .button-primary-flat:focus {
            background-color: #4cb0f9;
            border-color: #4cb0f9;
            color: #FFF;
        }

        .button-primary:active, .button-primary.active, .button-primary.is-active,
        .button-primary-flat:active,
        .button-primary-flat.active,
        .button-primary-flat.is-active {
            background-color: #2798eb;
            border-color: #2798eb;
            color: #0880d7;
        }

        .button-small {
            font-size: 1.1em;
            height: 2.2em;
            line-height: 2;
        }

        .title {
            color: gray;
            font-size: 16px;
        }

        .title-bold {
            font-weight: bold;
        }

        .descript {
            color: gray;
            font-size: 12px;
        }

        body,div,ul,li,p {
            margin: 0;
            padding: 0;
        }
        html,body{
            min-height: 100%;

        }

            display: block;
            position: relative;
            z-index: 1;
        }
        .title-text {
            color: #000;
            font-size: 22px;
            text-align: center;

            word-spacing: 16px;
            margin-top: 15px;
            position: relative;

    function GetRequest() {
        var url = location.search;
        var theRequest = new Object();
        if (url.indexOf("?") != -1){
            var str = url.substr(1);
            var strs = str.split("&");
            for(var i = 0; i < strs.length; i++){
                theRequest[strs[i].split("=")[0]] = (strs[i].split("=")[1]);
            }
        }
        return theRequest;
    }

    function faceauth(content) {
